import React from "react";

export default function CarComponent(props) {
  // const {brand, maker, year, price, color } = props
  const { brand, maker, year, price, color } = props.details;

  //NOTE: in a class component you will prepend your props with "this" keyword
  //e.g. this.props.details

  return (
    <div>
      <h1>Car details</h1>
      <p>Brand: {brand}</p>
      <p>Maker: {maker}</p>
      <p>Year: {year}</p>
      <p>Price: {price}</p>
      <p>Color: {color}</p>
      <hr />
    </div>
  );
}
